import React, { useEffect, useState } from "react";
import axios from "axios";

// import "../Styles/meme.css";
const Memes = () => {
  const [memes, setMemes] = useState([]);
  const url =
    "https://raw.githubusercontent.com/alenwelch/image-/main/api/Data.json";
  useEffect(() => {
    async function getData() {
      const request = await axios.get(url);
      setMemes(request.data);
      console.log(request.data);
      return request;
    }
    getData();
  }, [url]);
  return (
    <div className="meme">
      <div className="main-meme">
        <div className="gif-left">
          <img
            src="https://media.giphy.com/media/2hgd6Bf9OJg7UwWp3a/giphy.gif"
            alt=""
          />
        </div>
        <div className="meme-container">
          {memes.map((image) => (
            <div className="card-content">
              <img src={image.img} alt="avatar" className="image" />
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Memes;
